import base64
from dataclasses import dataclass

@dataclass
class Good:

    idItem : int
    name : str
    stock : int
    price : float
    imgSource : str

    def __init__(
            self,
            idItem : int = 0,
            name : str = "",
            stock : int = 0,
            price : float = 0,
            imgSource : str = ""
        ) -> None:
        self.idItem = idItem
        self.name = name
        self.stock = stock
        self.price = price
        self.imgSource = imgSource

    @property
    def get_idItem(self):
        return self.idItem

    @get_idItem.setter
    def set_idItem(self, value):
        self.idItem = value

    @property
    def get_name(self):
        return self.name

    @get_name.setter
    def set_name(self, value):
        self.name = value

    @property
    def get_stock(self):
        return self.stock

    @get_stock.setter
    def set_stock(self, value):
        self.stock = value

    @property
    def get_price(self):
        return self.price

    @get_price.setter
    def set_price(self, value):
        self.price = value

    @property
    def get_imgSource(self):
        return self.imgSource

    @get_imgSource.setter
    def set_imgSource(self, value):
        self.imgSource = value

    
    @staticmethod
    def image_to_base64(image_path : str):
        
        with open(image_path, "rb") as img_file:
            img_bytes = img_file.read()
            base64_str = base64.b64encode(img_bytes).decode("utf-8")
            return base64_str

    def equals(self, other : 'Good') -> bool:
        return self.get_idItem == other.get_idItem
    
    image_default = ""
